  input: '"TEXT","F3XA","C00020818","The funds reported on Schedule B supporting line
    22 were not in any way used in connection with any federal election, or any federal
    candidate, or any activities that qualify as Federal Election Activity.  Rather
    these transferred funds were utilized soley in connection with state and non-federal
    candidates and activities.    There are no wages reported on Schedule B supporting
    Line 30(b) because there are currently no employees who are providing services
    for any Federal Election Activity or who are spending more than 25 percent of
    their time on activities in connection with a federal election or any federal
    candidates.    All activity on this report is generic in nature and does not support
    any federal candidate or any other Federal Election Activity.    The definition
